package cn.sspku.zx.aad.leetcode;

/**
 * Implement strStr().
 * 
 * Returns a pointer to the first occurrence of needle in haystack, or null if
 * needle is not part of haystack.
 * 
 * @author zhangxu
 * 
 */
public class ImplementStrStr {
	// KMP算法？？？
	public String strStr(String haystack, String needle) {
		if (haystack == null || needle == null
				|| haystack.length() < needle.length())
			return null;

		if (needle.length() == 0)
			return haystack;

		int pH = 0, pN = 0, counterH, counterN;
		while (true) {
			// 找到与needle第一个匹配的字母
			while (pH <= (haystack.length() - needle.length())
					&& haystack.charAt(pH) != needle.charAt(pN))
				++pH;
			if (pH > haystack.length()- needle.length())
				return null;
			// 统计当前字母出现的次数
			counterH = 1;
			while (pH + counterH < haystack.length()
					&& haystack.charAt(pH) == haystack.charAt(pH + counterH))
				++counterH;
			counterN = 1;
			while (pN + counterN < needle.length()
					&& needle.charAt(pN) == needle.charAt(pN + counterN))
				++counterN;
			if (counterH < counterN) {
				pH += counterH;
				pN = 0;
			} else {
			    if(counterN==needle.length())
			        return haystack.substring(pH);
			        
				pH += counterH - counterN;
				pN = counterN;
				// 进行全面匹配
				while (pH + pN < haystack.length() && pN < needle.length()
						&& haystack.charAt(pH + pN) == needle.charAt(pN)) {
					++pN;
				}

				if (pN == needle.length())
					return haystack.substring(pH);
				pN = 0;
				++pH;
			}
		}
	}

	public static void main(String[] args) {
		ImplementStrStr iss = new ImplementStrStr();
//		String str1 = "";
//		String str2 = "";
//		String str3 = "mississippi";
//		String str4 = "issi";
		String str5 = "qqq";
		String str6 = "q";
//		String str7 = "abbbaaaaaaabbababbbbabababbbbbbbaaaaaaabbaaabbaababbbbababababaabbbbbbaaaaababbbbaaabababbbaaaabbbaabbbbbbabababbabaaaaabaabaaababbbaaabaababbaaabaaababbabbbbababaaaaaaababaabaabbaabbbaaabaaaaaa";
//		String str8 = "aabaaaabababbbabababbbaabaabaaaaabaabbbaabbbbba";
		Utils.Print(iss.strStr(str5, str6));
	}
}
